import React, { useState } from "react";
import styles from "./CreateEvent.module.css";

const CreateEvent = () => {
  const MAX_STEPS = 4;
  const [currentStep, setCurrentStep] = useState(1);

  const handleNext = () => {
    if (currentStep < MAX_STEPS) {
      setCurrentStep((prevStep) => prevStep + 1);
    }
  };

  const handlePrevious = () => {
    if (currentStep > 1) {
      setCurrentStep((prevStep) => prevStep - 1);
    }
  };

  const handleFinish = () => {
    window.location.reload();
  };

  const renderStepContent = (step) => {
    switch (step) {
      case 1:
        return (
          <div>
            <h2>Create a New Event</h2>
            <form>
              <label>
                Event Name:
                <input type="text" placeholder="Enter event name" />
              </label>
              <br />
              <label>
                Date:
                <input type="date" />
              </label>
            </form>
          </div>
        );
      case 2:
        return (
          <div>
            <h2>Event Details</h2>
            <p>
              Provide more information about your event, like location and
              description.
            </p>
            <form>
              <label>
                Location:
                <input type="text" placeholder="Enter location" />
              </label>
              <br />
              <label>
                Description:
                <textarea placeholder="Enter description"></textarea>
              </label>
            </form>
          </div>
        );
      case 3:
        return (
          <div>
            <h2>Review and Confirm</h2>
            <p>Check your event details and confirm everything is correct.</p>
            <button>Confirm</button>
          </div>
        );
      case 4:
        return (
          <div>
            <h2>Finish</h2>
            <p>Your event has been created successfully!</p>
          </div>
        );
      default:
        return <div>Unknown step</div>;
    }
  };

  return (
    <div className={styles.container}>
      <div className={styles.stepProgressBar}>
        {[...Array(MAX_STEPS - 1)].map((_, index) => (
          <div key={index} className={styles.step}>
            <p className={styles.stepText}>Step {index + 1}</p>
            <div
              className={`${styles.bullet} ${
                currentStep > index + 1 ? styles.completed : ""
              }`}
            >
              {index + 1 + "finish"}
            </div>
          </div>
        ))}
      </div>
      <div className={styles.main}>
        <p className={`${styles.content} ${styles.textCenter}`}>
          Step Number {currentStep}
        </p>
        {renderStepContent(currentStep)}
        <button
          className={styles.previousBtn}
          onClick={handlePrevious}
          disabled={currentStep === 1}
        >
          Previous
        </button>
        <button
          className={styles.nextBtn}
          onClick={handleNext}
          disabled={currentStep === MAX_STEPS}
        >
          Next
        </button>
        <button
          className={styles.finishBtn}
          onClick={handleFinish}
          disabled={currentStep !== MAX_STEPS}
        >
          Finish
        </button>
      </div>
    </div>
  );
};

export default CreateEvent;
